              <i className="fa fa-instagram"></i>
            </a>
          </div>
          <div className="profile-detials-name">
            <span className="primary-text">
              {" "}
              Hello, I'M <span className="highlighted-text">Maggie</span>
            </span>
          </div>
          <h1>
                {" "}
